double ball_coord[2] = {0, 0};
int beaver_coord[2] = {319 - 66 + 1, 209 - 56};
int fps = 60;
int score;
const int beaver_width = 66;
const int beaver_height = 56;
int beaverRightMost = 254;
int beaverLeftMost = 132;
double time_step = 1/60;
double grav_accerl= 9.80665;
double velocity_x = 0;
double velocity_y = 0;

// code not shown for clear_screen() and draw_line() subroutines
void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


void clear_screen (void){
    for (int x = 0; x < RESOLUTION_X; x++){
        for (int y = 0; y < RESOLUTION_Y; y++){
            plot_pixel (x, y, BLACK);
        }
    }
}

void set_A9_IRQ_stack(void){
    int stack, mode;
    stack = 0xFFFFFFFF - 7;

    mode = 0b11010010; //Change to IRQ mode with interrupts disabled
    asm("msr cpsr, %[ps]"::[ps]"r"(mode));

    asm("mov sp, %[ps]"::[ps]"r"(stack)); //Set the stack pointer

    mode = 0b11010011; //Go back to SVC mode
    asm("msr cpsr, %[ps]"::[ps]"r"(mode));
}

void config_GIC(void){
    //Configuring the HPS timer interrupt
    *((int *)0xFFFED8C4) = 0x01000000;
    *((int *)0xFFFED118) = 0x00000080;

    //configure the FPGA interval timer and KEYs interrupts
    *((int *)0xFFFED848) = 0x00000101;
    *((int *)0xFFFED108) = 0x00000300;

    //Set ICCPMR
    *((int *)0xFFFEC104) = 0xFFFF;

    //Set ICCICR
    *((int *)0xFFFEC100) = 1;

    //Configure ICDDCR
    *((int *)0xFFFED000) = 1;
}

void pushbutton_ISR(void){
    volatile int* KEY_ptr = (int *)0xFF200050;
    int press;
    int beaverCoordX;


    press = *(KEY_ptr + 3);
    *(KEY_ptr + 3) = press;

    if(press & 0x1){
        key_pressed = 0; //move beaver to right
        beaverCoordX = beaver_coord[0];

        //increment with each key 0 pressed
        beaverCoordX +=10;

        //update the coordinate
        beaver_coord[0] = beaverCoordX;

	//check if beaver hit the right boundary, don't increment
	if (beaverCoordX == beaverRightMost){
		beaverCoordX = beaverRightMost;
		beaver_coord[0] = beaverCoordX;
	}
    }
    else if(press & 0x2){
        key_pressed = 1; //shoot

    }
    else if(press & 0x4){
        key_pressed = 2; //move beaver to left
        beaverCoordX = beaver_coord[0];

        //decrement with each key 0 pressed
        beaverCoordX -= 10;

        //update the coordinate
        beaver_coord[0] = beaverCoordX;

	//check if beaver hit the left boundary, don't decrement;
	if (beaverCoordX == beaverLeftMost){
		beaverCoordX = beaverLeftMost;
		beaver_coord[0] = beaverCoordX;
	}
    }
    else{
        key_pressed = 3; //reset
        beaver_coord[0] = 319 - 66 + 1;
        beaver_coord[1] = 209 - 56;
        score = 0;
    }

    return;
}

void config_KEYs(){
    //KEY address
    volatile int* KEY_ptr = (int *)0xFF200050;

    *(KEY_ptr + 2) = 0xF;
}

void enable_A9_interrupts(void){
	int status = 0b01010011;
	asm("msr cpsr, %[ps]"::[ps]"r"(status));
}

int main(void){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    volatile int * HEX3_HEX0_DISPLAY = (int *) 0xFF200020;
    volatile int * HPS_GPIO1_ptr = (int *)0xFF709000;
    volatile int * LEDR_ptr = (int *)0xFF200000;
    volatile int * slider_switch_ptr = (int *)0xFF200040;
    volatile int HPS_timer_LEDG = 0x01000000;

    set_A9_IRQ_stack();
    config_GIC();
    config_KEYs();

    *(HPS_GPIO1_ptr + 0x1) = HPS_timer_LEDG;

    enable_A9_interrupts();



    while(1){
        pixel_buffer_start = *pixel_ctrl_ptr;

        clear_screen();

	//Coordinate calculation
        if(ball_in_the_air){
	    ball_coord[1] = ball_coord[1] - velocity_x * time_step;
            ball_coord[2] = ball_coord[2] - velocity_y * time_step + 0.5 * grav_accerl * (time_step) * (time_step);
            velocity_y = velocity_y - grav_accerl * time_step;
        }

	//Boundary Checking

        int arrayIndex = 0;
    	int arrayIndex2 = 1;
    	int beaverIndex = 0;
    	int beaverIndex2 = 1;

        for (int j = 0; j < 240; j++){
            for (int i = 0; i < 320; i++){
                short int background_clr = (BACKGROUND[arrayIndex2] << 8) + (BACKGROUND[arrayIndex]);
                plot_pixel (i , j, background_clr);
                if((beaver_coord[0] <= i && i <= beaver_coord[0] + beaver_width - 1) && (beaver_coord[1] <= j && j <= beaver_coord[1] + beaver_height - 1)){
                    short int beaver_clr = (BEAVER[2 * (i - beaver_coord[0]) + (132 * (i - beaver_coord[1]))] << 8) + (BEAVER[2 * (i - beaver_coord[0]) + 1 + (132 * (i - beaver_coord[1]))]);
                    if(beaver_clr != 0xD8FF){
                        plot_pixel(i, j, beaver_clr);
                    }
                }

                if (arrayIndex2 != 76800*2-1){
                    arrayIndex+=2;
                    arrayIndex2+=2;
                }
            }
        }
    }

}
